import React from 'react'
import { AuthConsumer } from '../helper/AuthContext'
import Home from '../pages/Home'

function DefineRoute(children) {
    return (
        <AuthConsumer>
            {({ isAuth }) => (
                <React.Fragment>{isAuth ? <Home /> : children}</React.Fragment>
            )}
        </AuthConsumer>
    )
}

export default DefineRoute
